import React, { useRef, useState, useEffect } from "react";
import { Redirect } from 'react-router';
import { Header } from "../../common/Header";
import {
    MDBBtn,
    MDBFreeBird,
    MDBCard,
    MDBCardBody,
    MDBCardImage,
    MDBCardText,
    MDBCol,
    MDBContainer,
    MDBFormInline,
    MDBIcon,
    MDBInput,
    MDBRow,
    MDBTable,
    MDBTableBody,
    MDBTableHead,
    MDBEdgeHeader,
    MDBCardTitle,
    MDBProgress,
    MDBListGroup,
    MDBListGroupItem,
    MDBBreadcrumb,
    MDBBreadcrumbItem
} from "mdbreact";
import { useHistory } from "react-router";
import { Chart } from "react-google-charts";
import "./style.css";
import domain from '../../assets/images/domain.png'
import { fetchData } from '../../services/apiConfig'
export const AccountsSelector = (props: any) => {
    const [AccountList, setAccountList] = useState(["DEV", "PRD"]);
    const accountList: any = new Array();
    useEffect(() => {
        fetchData('accounts', 'GET').then((res: any) => {
            console.log(res)
            for(let key in res){
               if(res[key] !== props.Account){
                console.log(res[key]);
                accountList.push(res[key]);
               }
            }
            setAccountList(accountList)
        })
    }, []);
    console.log(AccountList)
    const token = localStorage.getItem("token");
    console.log("accountSelector")
    if (token === null || token === undefined || token.length < 0) {
        return <Redirect to={{
            pathname: '/login',
        }} />
    }
    return (
        <>
            <MDBContainer fluid style={{ paddingTop: "2vw", paddingLeft: "2vw" }}>
                <MDBRow>
                    {/* <div>
                {AccountList.map((account: any, index:any) => {
                                return  <option value={index++} >{account}</option>
                           })}
                           </div> */}
                    <div>
                        <select className="custom-select" style={{ width: "250px" }} onChange={(e: any) => props.AccountToggle(e)} value={props.account}>
                           <option value="0" >{props.Account}</option>
                           {AccountList.map((account: any) => {
                                return <option>{account}</option>
                           })}
                        </select>
                    </div>
                </MDBRow>
            </MDBContainer>
        </>
    )
}
